import React from "react";
import { Link } from "react-router-dom";
function menu_left() {
  return (
    <div id="layoutSidenav_nav">
      <li>
        <Link to="./component/Executive/main.js">Main</Link>
      </li>
    </div>
  );
}

export default menu_left;
